bool check(int x) {
    int s = 0;
    std::bitset<128> f;

    f.set(0);

    while (x) {
        int k = x % 10;

        f |= f << k;
        s += k;
        x /= 10;
    }

    return s % 2 == 0 && f[s >> 1];
}

int solve(int x) {
    int res = f[x / SIZE];

    for (int i = x / SIZE * SIZE + 1; i <= x; i++) {
        if (check(i)) res++;
    }

    return res;
}

